import React from 'react';
import {BrowseRouter as Router, Switch, Route } from "react-router-dom";

import './App.css';

import Header from "./components/Header.js";
import Home from "./containers/Home.js";


function App() {
  return (
    <div className="SiteWrapper">
    <Header/>
    <Router>
    <Switch>
    <Route path="/">
    <Home/>
    </Route>
    </Switch>
    </Router>
    </div>
  );
}

export default App;
